DROP TABLE IF EXISTS `proveedores`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `proveedores` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `tipo_identificacion` enum('NIT','CÉDULA_DE_EXTRANJERÍA','CÉDULA_DE_CIUDADANÍA') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'NIT',
  `retenedor` enum('SI','NO') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'SI',
  `regimen_tributario` enum('SIMPLIFICADO','COMUN') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'COMUN',
  `tipo_cuenta` enum('CORRIENTE','AHORRO') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'CORRIENTE',
  `telefono` varchar(22) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `fax` varchar(29) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `email` varchar(190) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `cuenta_bancaria` varchar(160) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `razon_social` varchar(140) COLLATE utf8mb4_unicode_ci NOT NULL,
  `representante_legal` varchar(190) COLLATE utf8mb4_unicode_ci NOT NULL,
  `cedula` varchar(39) COLLATE utf8mb4_unicode_ci NOT NULL,
  `nro_identificacion` varchar(60) COLLATE utf8mb4_unicode_ci NOT NULL,
  `edo_reg` smallint(6) NOT NULL DEFAULT '1',
  `codigo_proveedor` varchar(7) COLLATE utf8mb4_unicode_ci NOT NULL,
  `direccion` text COLLATE utf8mb4_unicode_ci,
  `ciudad_id` int(10) unsigned NOT NULL,
  `banco_id` int(10) unsigned NOT NULL,
  `telefono_representante` varchar(33) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `email_representante` varchar(200) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `proveedores_ciudad_id_foreign` (`ciudad_id`),
  KEY `proveedores_banco_id_foreign` (`banco_id`),
  CONSTRAINT `proveedores_banco_id_foreign` FOREIGN KEY (`banco_id`) REFERENCES `bancos` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `proveedores_ciudad_id_foreign` FOREIGN KEY (`ciudad_id`) REFERENCES `ciudades` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=27 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
